@JoshLind I'm just curious about (1) why 

> we cannot yet support any proof versions up to the max,

but I will wait to hear about it during your state sync overview session. Thank you! 😃

Thanks for the report! This issue has been resolved since it was posted (I won't dig into the exact commit), now both `signer` and `address` are contextually interpreted as either a keyword or as an identifier:

```
script {
    fun main() {
        // Compiles (but with warnings about unused assignments/bindings):
        let address: u8 = 1;
        let signer: u8 = 2;
    }
}
```

What is the purpose of the hash at the adapter layer?

I feel we might want to have a more well defined hashing function for the compiled module if we want to bake this in (depending on what you are doing of course)

@tzakian might have some thoughts on this too as we have discussed hashing compiled modules for checksums among other things

another option might be to use a deterministic hashmap (i.e., just seed it with a constant). of course, this makes HashDoS attacks much easier.... it also only guarantees same iteration ordering if the insertions/removals are serializably equivalent i think. on the plus side, it's (probably) faster?

```rust
use fnv::FnvHasher;
use std::hash::BuildHasher;

pub struct DeterministicBuildHasher;

impl BuildHasher for DeterministicBuildHasher {
    type Hasher = FnvHasher;

    fn build_hasher(&self) -> Self::Hasher {
        const SEED: u64 = 0xDEADBEEF;
        FnvHasher::with_key(SEED)
    }
}

pub type DeterministicHashMap<K, V> = HashMap<K, V, DeterministicBuildHasher>;
```

on the broader topic of determinism, we probably need to be a bit more intentional than `s/HashMap/BTreeMap/g`. for example, state-sync, mempool, and network are all highly parallel / concurrent and so determinism is already out the window. personally, I would like to see deterministic hashmaps/sets for use in simulation tests, but that's only because the simulation can control the concurrency.

the key parts of the protocol that depend on determinism are execution, VM, and parts of DB. we probably need to add some aggressive lints to ban sources of non-determinism like rand, logging, threads, filesystem, clocks, etc... also in transitive dependencies. of course, things like parallel execution make this difficult : p

@bob-wilson Sounds reasonable to me. Let me change it to "vasp" (or whatever else that's appropriate and indicative.) @tzakian Can you confirm that the operations here (update limits, publish window) are indeed specific to parent vasps? Thanks!

> It would be even better IMO to add comments to explain what each test is doing and reasons for expected failures.

Will do.

Here are some thoughts from a safety viewpoint, which also fits well with the semantics the prover assumes.

Our problem is that we want to let some external untrusted entity create values which flow into our trusted managed computation environment.  The simple principle we apply *today* for Move module encapsulation is that each module controls over its public API what access to its data it gives to external entities.

Why can't we apply the same protection for external callers? Lets assume external code *could* fast and synchronously call into public Move functions to construct and interpret data (perhaps with nicely generated APIs). We could even have a new entry point function, `fun(adapter)`, for this purpose, 

Example:

```
module M {
   struct R has key { x: u64, y: u64 } spec R { invariant x > y; }
   public fun(adapter) make_R(x: u64, y: u64): R { R{x,y} }
   public fun(script) store(s: &signer, r: R) { move_to<R>(s, r) }
}
```
[1]

It's now up to the module designer how much havoc it would external callers allow on its data, same as today in Move.  Whether mutable references are passed in and out and mutable or not does not cause new complications. Consider we would have:

```
module M {
   public fun(adapter) expose(c: &mut ContainerOfR): &mut R { &mut c.r }
} 
```

For the prover, functions like the above are problematic with or without external callers. That's why we have introduced friends, so we can prune down the need for such public functions [2]. Something like the above should perhaps not be a public API in the first place, but this should be just methodology IMO.

[1]: Technically, for in-process calls, such adapter functions should be implementable quite fast. They also probably need to be side-effect free, that is do not read or write global state.
[2]: I wish we just had package visibility, that would simplify Move usage

> @wrwg, I like the idea of marking what functions can or cannot be invoked by `execute_function`

With well defined entry points for adapters, we would not only allow module developers to protect against native code, we can also generate specific Rust bindings for those functions which hide some details of the VM and allow us long term to change the ABI underneath without breaking anybody. I think this would be an important steps towards making Move an embeddable language in many places.

Here are some ideas about the Rust API for this. First we would have strong Rust level encapsulation of move values, references, and mutable references (some of this likely already exists). We would use a type tag to make those strongly typed:

```
struct MoveValue<T> { _p: PhantomData<T>, ...}    
struct MoveRef<T> { _p: PhantomData<T>, ...}        
struct MoveMutRef<T> { _p: PhantomData<T>, ...}  

trait MoveDestroy<T> {
  fn destroy(self);
}
trait MoveCopy<T> {
  fn copy(&self) -> Self;
}
trait MoveFreeze<T> {
  fn freeze(self) -> MoveRef<T>;
}
trait MoveAsRef<T> {
  fn as_ref(&self) -> MoveRef<T>;
}
trait MoveAsMutRef<T> {
  fn as_mut_ref(&elf) -> MoveMutRef<T>;
}

// Depending on the actual T, below is what the different types can implement.
impl<T> MoveDestroy<T>, [MoveCopy<T>], MoveAsRef<T>, MoveAsMutRef<T>; 
impl<T> MoveDestroy<T>, MoveCopy<T>  for MoveRef<T>; 
impl<T> MoveDestroy<T>, MoveFreeze<T>  for MoveMutRef<T>; 
```

The values here would mirror Move type discipline and abilities, which may differ by type instance. As Rust does not have a way to disallow drop at compile time, this one aspect would be checked at runtime.

The generated API for adapters for the example module `M` in the thread would e.g. look as follows:

```
/// This code is automatically generated from module M
struct M_R(); // type tag
fn make_R(x: u64, y: u64) -> MoveValue<R>;
fn expose(c: MoveMutRef<M_ContainerOfR>) -> MoveMutRef<M_R>;

impl Drop for MoveValue<M_R> {
  fn drop(self) { panic!("value cannot be dropped") }
}
```

Some discussion questions:

If I start with Move code like
```
module 0x1::M {
  struct S1<T> { a: address, s2: S2<T>, t: T }
  struct S2<T> { b: bool, t: T }
}
```

, I can now do

```
move sandbox publish M.move
move sandbox generate struct-layouts --module storage/0x00000000000000000000000000000001/modules/M.mv --struct S1 --type-args u64 > layout.yaml
serdegen layouts.yaml --language rust
```

to get the following Rust bindings

```
#![allow(unused_imports)]
use std::collections::BTreeMap as Map;
use serde::{Serialize, Deserialize};
use serde_bytes::ByteBuf as Bytes;

#[derive(Clone, Debug, PartialEq, PartialOrd, Serialize, Deserialize)]
pub struct 00000000000000000000000000000001::M::S2<u64> {
    pub b: bool,
    pub t: u64,
}

#[derive(Clone, Debug, PartialEq, PartialOrd, Serialize, Deserialize)]
pub struct AccountAddress(pub [u8; 16]);

#[derive(Clone, Debug, PartialEq, PartialOrd, Serialize, Deserialize)]
pub struct 00000000000000000000000000000001::M::S1<u64> {
    pub a: AccountAddress,
    pub s2: 00000000000000000000000000000001::M::S2<u64>,
    pub t: u64,
}

#[derive(Clone, Debug, PartialEq, PartialOrd, Serialize, Deserialize)]
pub struct Signer(pub [u8; 16]);
```

This is a great start, but there's obviously a few issues:
- The code won't compile because a fully qualified Move module name like `01::M::S1<u64>` is not a valid Rust identifier.
- The generator can only generate code for closed types, so we'll end up creating a struct definition for each specialization of a generic type. From looking at serde `Format` and `ContainerFormat` I don't *think* we can do any better than this (they require closed types), but I could be wrong.
- We generate definitions for Move ground types like `AccountAddress`, but it might be nice for those to live elsewhere
- It might be nice to group generated struct definitions into a namespace per address and/or per module

Curious to hear thoughts on which of these are addressable/how we should tackle it.

@bob-wilson we're trying to unify the multi token and single token resource for consistency, so it's either we have self-contained token (waste space for multi tokens) or separate TokenData for single tokens.

Re mutability, I think we'd need the owner to delegate the ability to a service provider to mint (and mutate) the token on behalf.

definitely worth more discussions.

