Sorry, I don't understand why you can't do 
```
pub const LENGTH: usize = if cfg!(feature = "address20") { 20 } else { 16 };
``` 
Or 
```
pub const LENGTH: usize = if cfg!(feature = "address20") {
    20
} else if cfg!(feature = "address16") {
    16
} else {
    panic!("address feature not specified")
};
```

> We could though write back earlier however I wonder how complete would this be anyway?

The current logic is to instrument a write-back whenever a reference goes out of scope (i.e., the reference is no longer live). This is different from the prior notion that the reference can be dying but it child (i.e., another reference borrowed out of it) is still alive.

> What happens if we have an inlined spec block which tries to access a &mut which is still alive after the code block? It appears if we fix this just for the lucky case where the &mut goes out of scope before the spec block, we may have some subtle effects if this is changed, so perhaps it is cleaner to just not support this (and perhaps even produce an error message).

I see the point. And here can be one example:

```
let a = 0;
let p = &mut a;
*p = 1;
spec { assert a == 1; }; --> this assert will fail because p is not written back yet (because p is still alive)
*p = 2;
```

Yes, in this sense, I agree that it is perhaps cleaner not to support it at all.

Or rather, to be really complete, we could do a write-back after every `WriteRef`. But this is obviously not good performance-wise.

> I also thought this an issue and even had partially coded to put this into the borrow graph. Then I recognized that they cannot be two outstanding &mut for the same global resource because of acquires semantics which guarantees that any global resource can only be borrowed once.

That is true and thanks for the clarification!

I think the code there is trying to address a slightly different issue. Here is an illustration

```
    public fun diff_resource(cond: bool, a: address) acquires T, R {
        let x = if (cond) {
            let t1 = borrow_global_mut<T>(a);
            &mut t1.x
        } else {
            let t2 = borrow_global_mut<R>(a);
            &mut t2.x
        };
        *x = 0;
    }
```

Now consider the case when we are writing-back `x`, and we don't have the `t1` and `t2` as proxies of the write-back.

We will do a test to see whether `x` is derived from the global resource `T` or `R`. But based on what we have in the `$Mutation` (in prelude),

```
function {:constructor} $Global(a: int): $Location;  ==> for location

p: Vec int ===> for path
```

There is not enough information telling us whether this `x` is pointing to `T` or `R`. This is the motivation behind adding a type-id field in the `$Global` constructor:

```
function {:constructor} $Global(a: int, t: int): $Location;
```

Now this `t: int` will help differentiate whether `x` points to `struct T` or `struct R` as they will be assigned different ids.
